import scala.annotation.tailrec
import math.{pow => scalaPow}

def factorial(n: Int): Long = {
    @tailrec
    def f(n: Int, accum: Long): Long = {
        n match {
            case 0 => accum
            case _ => f(n - 1, n * accum)
        }
    }
    f(n, 1)
}

def average(arr: Array[Double]): Double = arr.sum / arr.length

import scala.collection.mutable.ArrayBuffer
import breeze.stats.distributions.Exponential
import math.{pow => scalaPow}

case class BirthAndDeathSystem(n: Int, m: Int, lambda: Double, _mu: Double, p: Double, 
                                dt: Double, nEvent: Int, nTotal: Int, name: String = "system") {

  val mu = _mu * p
  var state = 0
  val history = ArrayBuffer.empty[List[Double]]

  var queue = 0
  val channels = ArrayBuffer.fill(n)((0.0, 0.0))

  val exponential = new Exponential(lambda)
  var nextEventTime = exponential.draw
  val eventTime = nEvent * dt

  val ro = lambda / mu
  val p0 = 1.0 / ((0 to n).map(i => scalaPow(ro, i) / factorial(i)).sum + (1 to m).map(i => scalaPow(ro, n + i) / (scalaPow(n, i) * factorial(n))).sum)

  def run(): Unit = {
    (0 to nTotal).foreach(i => {
      val time = dt * i
      channels.indices.foreach(i => {
        if (channels(i)._1 == 1.0 && time - channels(i)._2 >= 1 / mu) channels(i) = (0.0, 0.0)
      })
      var canBePlaced = channels.count(_._1 == 0)
      var index = 0
      while (index < channels.length && queue > 0 && canBePlaced > 0) {
        if (channels(index)._1 == 0) {
          channels(index) = (1.0, time)
          queue -= 1
          canBePlaced -= 1
        }
        index += 1
      }

      val isEvent = if (time <= eventTime && time >= nextEventTime) {
        nextEventTime = time + exponential.draw
        1.0
      } else 0.0
      var isDeclined = 0.0
      var isAccepted = 0.0
      if (isEvent == 1) {
        if (canBePlaced > 0) {
          val freeChannel = channels.indexWhere(_._1 == 0)
          channels(freeChannel) = (1.0, time)
          canBePlaced -= 1
          isAccepted = 1.0
        }
        else {
          if (m - queue > 0) {
            queue += 1
            isAccepted = 1.0
          }
          else isDeclined = 1.0
        }
      }
      val queueVector = List.fill(queue)(1.0) ++ List.fill(m - queue)(0.0)

      state = n - canBePlaced + queue
      val stateVector = for (i <- 0 to n + m) yield if (i == state) 1.0 else 0.0

      val currentState = List(time, isEvent, isAccepted, isDeclined) ++ channels.map(_._1) ++ queueVector ++ stateVector
      history += currentState
    })
  }

  def getHistoryLength(): Int = nEvent

  def getFinalProbabilitiesEmp(): List[Double] = {
    val withEventsHistory = history.take(nEvent)
    (0 to n + m).map(state => withEventsHistory.map(v => v(4 + n + m + state)).sum / nEvent).toList
  }

  def getFinalProbabilitiesTheo(): List[Double] = {
    List(p0) ++ (1 to n).map(i => p0 * scalaPow(ro,i) / factorial(i)) ++ (1 to m).map(i => p0 * scalaPow(ro, n + i) / (scalaPow(n, i) * factorial(n)))
  }

  def getAvgProcessingRequestsCountEmp(): Double = {
    average(history.map(col => col.slice(4, 4 + n).count(_ == 1).toDouble).toArray)
  }

  def getAvgProcessingRequestsCountTheo(): Double = {
    ro * (1 - scalaPow(ro, n + m) * p0 / (scalaPow(n, m) * factorial(n)))
  }

  def getAvgQueueLengthEmp(): Double = {
    average(history.map(col => col.slice(4 + n, 4 + n + m).count(_ == 1).toDouble).toArray)
  }

  def getAvgQueueLengthTheo(): Double = {
    p0 * (scalaPow(ro, n + 1) * (1 - scalaPow(ro / n, m) * (1 + m * (1 - ro / n)))) / (n * factorial(n) * scalaPow(1 - ro / n, 2))
  }

  def getDeclineProbabilityEmp(): Double = {
    history.count(_(3) == 1) / history.count(_(1) == 1).toDouble
  }

  def getDeclineProbabilityTheo(): Double = {
    (scalaPow(ro, n + m) / (scalaPow(n, m) * factorial(n))) * p0
  }

  def getRelativeThroughputEmp(): Double = {
    history.count(_(2) == 1) / history.count(_(1) == 1).toDouble
  }

  def getRelativeThroughputTheo(): Double = {
    1 - getDeclineProbabilityTheo()
  }

  def getAbsThroughputEmp(): Double = {
    lambda * getRelativeThroughputEmp()
  }

  def getAbsThroughputTheo(): Double = {
    lambda * getRelativeThroughputTheo()
  }

  def printHistory(n: Int): Unit = {
    println("Time\tDimension")
    setDimensionsOrder()
    history.take(n).foreach(printHistoryColumn)
  }

  def setDimensionsOrder(): Unit = {
    println(s"0\tTime")
    println(s"0\tEvent")
    println(s"0\tAccepted")
    println(s"0\tDeclined")
    (1 to n).foreach(i => println(s"0\tChannel $i"))
    (1 to m).foreach(i => println(s"0\tQueue $i"))
    (0 to n + m).foreach(i => println(s"0\tState $i"))
  }

  def printHistoryColumn(col: List[Double]): Unit = {
    val time = col.head
    col.indices.foreach(index => {
      if (col(index) > 0) {
        index match {
          case 0 => println(s"$time\tTime")
          case 1 => println(s"$time\tEvent")
          case 2 => println(s"$time\tAccepted")
          case 3 => println(s"$time\tDeclined")
          case i if i > 3 && i < 4 + n => println(s"$time\tChannel ${i - 3}")
          case i if i >= 4 + n && i < 4 + n + m => println(s"$time\tQueue ${i - n - 3}")
          case i if i >= 4 + n + m => println(s"$time\tState ${i - m - n - 4}")
        }
      }
    })
  }
}
